DROP TABLE IF EXISTS restaurants;
CREATE TABLE IF NOT EXISTS  restaurants(
   id                      VARCHAR(9) NOT NULL PRIMARY KEY
  ,name                    VARCHAR(38) NOT NULL
  ,branch                  VARCHAR(21) NOT NULL
  ,phone                   VARCHAR(18) NOT NULL
  ,email                   VARCHAR(63) NOT NULL
  ,logo                    VARCHAR(44) NOT NULL
  ,address                 VARCHAR(36) NOT NULL
  ,housenumber             VARCHAR(11) NOT NULL
  ,postcode                VARCHAR(11) NOT NULL
  ,city                    VARCHAR(23) NOT NULL
  ,latitude                NUMERIC(10,7)
  ,longitude               NUMERIC(9,7)
  ,url                     VARCHAR(35) NOT NULL
  ,open                    INTEGER  NOT NULL
  ,bestMatch               INTEGER  NOT NULL
  ,newestScore             INTEGER  NOT NULL
  ,ratingAverage           INTEGER  NOT NULL
  ,popularity              INTEGER  NOT NULL
  ,averageProductPrice     NUMERIC(5,2)
  ,deliveryCosts           NUMERIC(4,2) NOT NULL
  ,minimumOrderAmount      VARCHAR(5) NOT NULL
);
